import React, { useState } from "react";
import "./Blog.css";

const TabsGrid = () => {
  const [activeTab, setActiveTab] = useState(1);

  // Custom data for 5 tabs, 3 rows × 5 columns
  const tabsData = [
    {
      tabName: "Tab 1",
      content: [
        [
          { img: "/images/img1.jpg", title: "Apple", desc: "Fresh red apples." },
          { img: "/images/img2.jpg", title: "Banana", desc: "Yellow bananas." },
          { img: "/images/img3.jpg", title: "Cherry", desc: "Sweet cherries." },
          { img: "/images/img4.jpg", title: "Date", desc: "Delicious dates." },

        ],
        [
          { img: "/images/img6.jpg", title: "Fig", desc: "Juicy figs." },
          { img: "/images/img7.jpg", title: "Grape", desc: "Purple grapes." },
          { img: "/images/img8.jpg", title: "Honeydew", desc: "Sweet honeydew melon." },
          { img: "/images/img9.jpg", title: "Kiwi", desc: "Tangy kiwi fruit." },
          { img: "/images/img10.jpg", title: "Lemon", desc: "Sour lemons." },
        ],
        [
          { img: "/images/img11.jpg", title: "Mango", desc: "Ripe mangoes." },
          { img: "/images/img12.jpg", title: "Nectarine", desc: "Delicious nectarines." },
          { img: "/images/img13.jpg", title: "Orange", desc: "Juicy oranges." },
          { img: "/images/img14.jpg", title: "Papaya", desc: "Tropical papayas." },
          { img: "/images/img15.jpg", title: "Quince", desc: "Exotic quinces." },
        ],
      ],
    },
    // Repeat for Tabs 2–5 with different content
    {
      tabName: "Tab 2",
      content: [
        [
          { img: "/images/img16.jpg", title: "Rose", desc: "Red roses." },
          { img: "/images/img17.jpg", title: "Tulip", desc: "Bright tulips." },
          { img: "/images/img18.jpg", title: "Sunflower", desc: "Sunny sunflowers." },
          { img: "/images/img19.jpg", title: "Daisy", desc: "White daisies." },
          { img: "/images/img20.jpg", title: "Lily", desc: "Elegant lilies." },
        ],
        [
          { img: "/images/img21.jpg", title: "Orchid", desc: "Beautiful orchids." },
          { img: "/images/img22.jpg", title: "Marigold", desc: "Golden marigolds." },
          { img: "/images/img23.jpg", title: "Lavender", desc: "Fragrant lavender." },
          { img: "/images/img24.jpg", title: "Jasmine", desc: "Sweet jasmine." },
          { img: "/images/img25.jpg", title: "Hibiscus", desc: "Tropical hibiscus." },
        ],
        [
          { img: "/images/img26.jpg", title: "Peony", desc: "Lovely peonies." },
          { img: "/images/img27.jpg", title: "Poppy", desc: "Bright poppies." },
          { img: "/images/img28.jpg", title: "Chrysanthemum", desc: "Colorful chrysanthemums." },
          { img: "/images/img29.jpg", title: "Iris", desc: "Beautiful irises." },
          { img: "/images/img30.jpg", title: "Carnation", desc: "Fragrant carnations." },
        ],
      ],
    },
    {
      tabName: "Tab 3",
      content: [
        [
          { img: "/images/img31.jpg", title: "Car", desc: "Sports car." },
          { img: "/images/img32.jpg", title: "Bike", desc: "Mountain bike." },
          { img: "/images/img33.jpg", title: "Bus", desc: "City bus." },
          { img: "/images/img34.jpg", title: "Train", desc: "High-speed train." },
          { img: "/images/img35.jpg", title: "Plane", desc: "Airplane in sky." },
        ],
        [
          { img: "/images/img36.jpg", title: "Boat", desc: "Sailing boat." },
          { img: "/images/img37.jpg", title: "Truck", desc: "Delivery truck." },
          { img: "/images/img38.jpg", title: "Scooter", desc: "Electric scooter." },
          { img: "/images/img39.jpg", title: "Helicopter", desc: "Rescue helicopter." },
          { img: "/images/img40.jpg", title: "Submarine", desc: "Deep-sea submarine." },
        ],
        [
          { img: "/images/img41.jpg", title: "Tractor", desc: "Farm tractor." },
          { img: "/images/img42.jpg", title: "Van", desc: "Family van." },
          { img: "/images/img43.jpg", title: "Rickshaw", desc: "Auto rickshaw." },
          { img: "/images/img44.jpg", title: "Jet", desc: "Private jet." },
          { img: "/images/img45.jpg", title: "Hot Air Balloon", desc: "Sky balloon." },
        ],
      ],
    },
    // You can add Tab 4 and Tab 5 in same structure
  ];

  return (
    <div className="tabs-container">
      <div className="tabs-header">
        {tabsData.map((tab, index) => (
          <button
            key={index}
            className={activeTab === index + 1 ? "active" : ""}
            onClick={() => setActiveTab(index + 1)}
          >
            {tab.tabName}
          </button>
        ))}
      </div>

      <div className="tabs-content">
        {tabsData.map((tab, index) => (
          <div
            key={index}
            className={`tab-panel ${activeTab === index + 1 ? "active" : ""}`}
          >
            {tab.content.map((row, rowIndex) => (
              <div key={rowIndex} className="tab-row">
                {row.map((item, colIndex) => (
                  <div key={colIndex} className="tab-item">
                    <img src={item.img} alt={item.title} />
                    <h4>{item.title}</h4>
                    <p>{item.desc}</p>
                  </div>
                ))}
              </div>
            ))}
          </div>
        ))}
      </div>
    </div>
  );
};

export default TabsGrid;
